  componentWillMount() {
    if (cookie) {
      cookie.remove("cookie", { path: "/" });
      localStorage.removeItem("email");
      localStorage.removeItem("role");
    }
  }
  render() {
    const { companySignupRequest } = this.props;
    return (
      <div className="row">
        <div>
          <CompanySignupForm companySignupRequest={companySignupRequest} />
        </div>
      </div>
      //return
    );
    //render
  }
}

